  "<ul><li><passive>Spellblade:</passive> After using an Ability, your next Attack is enhanced with an additional <physicalDamage>@SpellbladeDamage@ physical damage</physicalDamage> {{ Item_Keyword_OnHit }} (@SpellbladeCooldown@{{ Item_Cooldown }}).</ul>": 7,
  "<ul><li>Meeps currently deal <magicDamage><scaleLevel>@f1@</scaleLevel> <scaleAP>(+@f9@)</scaleAP> magic damage</magicDamage> and apply a <font color='#ffffff'>@f2@%</font> slow for @f3@ second. A new meep appears every <font color='#ffffff'>@f5@</font> seconds, max of <font color='#ffffff'>@f4@</font>.</li></ul>": 16,
  "<ul><li><font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, meep attacks will <font color='#eeeeee'>deal @f8@ more damage.</font></li></ul>": 10,
  "<ul><li>Meeps strike through their target in a cone, dealing <magicDamage><scaleLevel>@f1@</scaleLevel> <scaleAP>(+@f9@)</scaleAP> magic damage</magicDamage> and applying a <font color='#ffffff'>@f2@%</font> slow for @f3@ second to all enemies hit. A new meep appears every <font color='#ffffff'>@f5@</font> seconds, max of <font color='#ffffff'>@f4@</font>.</li></ul>": 20,
  "<ul><li>\t<font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, meep attacks will <font color='#eeeeee'>Slow by @f8@%</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 4,
  "<ul><li>Mini boxes deal <magicDamage>@Spell.HallucinateFull:AoEDamage@ magic damage</magicDamage>, or <magicDamage>@Spell.HallucinateFull:STDamage@ magic damage</magicDamage> if attacking only one enemy, and <status>Fears</status> enemies for @Spell.HallucinateFull:BoxFearDuration@ second(s).</li><li>Clone deals @Spell.HallucinateFull:CloneAADamagePercent*100@% of Shaco's damage and receives @Spell.HallucinateFull:CloneIncomingDamagePercent*100@% increased damage.</li></ul>": 5,
  "<ul><li>Use Sonic Wave before Dragon's Rage so you can chase the target with Resonating Strike.<li>Take advantage of Flurry by weaving in basic attacks between spell casts - this maximizes damage output and minimizes Energy loss.<li>Self-casting Safeguard and using Iron Will are powerful tools for killing neutral monsters (in the jungle).</ul>": 2,
  "<ul><li>\t<font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, Bard will be able to have <font color='#eeeeee'>@f8@ more meep following at once</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 4,
  "<ul><li>Stay spread out to minimize the impact of Lee Sin's ultimate, Dragon's Rage.<li>Lee Sin has powerful tools to combat physical damage in Iron Will and Cripple but he is still vulnerable to magic damage.<li>Lee Sin relies heavily on following up with his abilities. Use disables to prevent him from chaining together his abilities and attacks.</ul>": 2,
  "<ul><li>\t<font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, the meep attack <font color='#eeeeee'>strike-through cone increases in size</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 4,
  "<ul><li>Orianna can only affect the area the Ball is around. Use this to your advantage.<li>Watch out for Orianna's Ball returning to her due to leashing. This may cause some unexpected situations.</ul>": 2,
  "<ul><li>\t<font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, meep attacks will <font color='#eeeeee'>gain @f8@ damage.</font></li></ul>": 4,
  "<ul><li>Command: Protect can be used on yourself to return the Ball back to you quickly. Combine this with Command: Attack for a quick harassment.<li>Command: Dissonance is a very powerful escape tool if Orianna has the Ball. The combination of speed and leaving a slowing obstacle can be quite powerful.<li>Command: Shockwave can be used to drag enemies towards you or away from you if you position the Ball properly.</ul>": 2,
  "<ul><li><font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, meep attacks will <font color='#eeeeee'>strike through their target</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 5,
  "<ul><li><font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, meeps will <font color='#eeeeee'>reappear @f8@ second faster</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 5,
  "<ul><li><font color='#cccc00'>@f10@ chimes</font> collected - with <font color='#eeee00'>@f7@ more</font>, Bard will be able to have <font color='#eeeeee'>@f8@ more meep following at once</font> and deal <font color='#ffffff'>@f11@</font> more damage.</li></ul>": 6,
  "<ul><li><scaleLevel>Level @LevelForPassiveRank0@ - Zealous:</scaleLevel> Attacks grant <attackSpeed>@EnrageTotalASPerStack@% Attack Speed</attackSpeed> for @EnrageDuration@ seconds (max 5 stacks). At max stacks Kayle becomes Exalted, gaining <speed>@MSTowardsEnemy*100@% Move Speed</speed>.<br></li><li><scaleLevel>Level @LevelForPassiveRank1@ - Arisen: </scaleLevel>Attack range is increased to @UpgradedAttackRange@.<br></li><li><scaleLevel>Level @LevelForPassiveRank2@ - Aflame:</scaleLevel> Exalted attacks launch fire waves that deal <magicDamage>@PassiveWaveDamage@ magic damage</magicDamage>.<br></li><li><scaleLevel>Level @LevelForPassiveRank3@ - Transcendent:</scaleLevel> Become permanently Exalted. Attack range is increased to @FinalAttackRange@.</li></ul>": 3,
