  "<flavorText>\"Meet my new best friend. Time to go on an adventure!\"</flavorText>": 8,
  "<flavorText>\"He has been called many things. A carapace helm. A second skin. A living tomb...\"</flavorText>": 28,
  "<flavorText>For a limited time only, get a free hat with every purchase!</flavorText>": 5,
  "<flavorText>\"Cast down the Noxians\" <br>– Bobdyr, Temple Guardsman</flavorText>": 8,
  "<flavorText>''There's only one way you'll get this armor from me...'' - forgotten namesake</flavorText>": 19,
  "<flavorText>“Collect enough, and the names all start to blur together.” — Samira</flavorText>": 7,
  "<flavorText>'If you listen closely, you can still hear the bustle of the city over the screams.'</flavorText>": 25,
  "<flavorText>For people who gotta go FAST. Made with lightning. REAL lightning!</flavorText>": 5,
  "<flavorText>''A still more glorious dawn awaits.''</flavorText>": 2,
  "<flavorText>\"She swore to dedicate her life to his destruction...\"</flavorText>": 16,
  "<flavorText>Made with 100% real cherries. Warning: May cause imbiber to deal tons of damage.</flavorText>": 5,
  "<flavorText>''If you want to make a Singularity from scratch, you must first destroy the universe.''</flavorText>": 2,
  "<flavorText>This savory blend of free-range, grass-fed Avarosan game hens and organic, non-ZMO Freljordian herbs contains the essential nutrients necessary to keep your Poro purring with pleasure.<br><br>All proceeds will be donated towards fighting Noxian animal cruelty. </flavorText>": 8,
  "<flavorText>'These blessed waters still carry their power to the worthy.'</flavorText>": 9,
  "<flavorText>The dearly beloved gathered, but soon there would be much more to mourn.</flavorText>": 26,
  "<flavorText>'Fashionable and functional.'</flavorText>": 8,
  "<flavorText>Our specially formulated veggie blend is proven to harden your skin to resist even the strongest attacks!</flavorText>": 5,
  "<flavorText>\"It must do something...<br>Declined, it does EVERYTHING\"</flavorText>": 13,
  "<flavorText>“The barest hint of movement, a sharp breath in, then darkness.” —Kinkou Rite of Passage</flavorText>": 13,
  "<flavorText>''This item is dedicated in honor of Ionia's victory over Noxus in the Rematch for the Southern Provinces on 10 December, 20 CLE.'</flavorText>": 16,
  "<flavorText>''The stars call to us.''</flavorText>": 2,
  "<flavorText>One cut is all it takes.</flavorText>": 15,
  "<flavorText>\"She swore to dedicate her life to his destruction. The gauntlets heard.\"</flavorText>": 2,
  "<flavorText>When finally the blade dropped from his fingers, anger quenched by a sea of blood, all that was left... was emptiness.</flavorText>": 6,
